import React from 'react';
import styled from 'styled-components';

import Figure from '../images/figure-3.svg';
import { Title } from '../style/style';

const Container = styled.div`
  ${'' /* position: relative;
  overflow: hidden; */}
  width: 100vw;
  height: 92vh;
  display: flex;
`;

const FigureIcon = styled.img`
  ${'' /* position: absolute;
  left: 3rem;
  bottom: -5rem; */}
  width: 30rem;
  height: auto;
`;

const Span = styled.span`
  display: block;
  margin-top: 2rem;
`;

function Congraturation() {
  return (
    <Container>
      <FigureIcon src={Figure} />
      <Title size="lg">
        Congraturation!
        <Span>I wish you have a good day.</Span>
      </Title>
    </Container>
  );
}

export default Congraturation;
